import React from "react";
import {
  Table,
  TableBody,
  TableHead,
  TableRow,
  TableCell,
  Fab,
  Box,
} from "@material-ui/core";
import AddIcon from "@material-ui/icons/Add";
import TableTaskItem from "./TableTaskItem";

export default function TableTask() {
  return (
    <Table sx={{ position: "relative" }}>
      <TableHead>
        <TableRow></TableRow>
      </TableHead>
      <TableBody>
        <TableTaskItem />
        <TableTaskItem />
        <TableTaskItem />
        <TableRow>
          <TableCell></TableCell>
          <TableCell></TableCell>
          <TableCell></TableCell>
          <TableCell></TableCell>
          <TableCell>
            <Fab
              color="primary"
              //   sx={{ position: "absolute", bottom: "0", right: "0" }}
              className="button-add"
              aria-label="add"
            >
              <AddIcon />
            </Fab>
          </TableCell>
        </TableRow>
        {/* <Box sx={{ height: "57px" }}></Box> */}
      </TableBody>
    </Table>
  );
}
